code = ""

code = bytes.fromhex(code)

flag = ''

def xor_block_with_int(target: bytes, xor: int):
    ret = b''
    for i in range(len(target)):
        ret += (target[i] ^ xor).to_bytes()
    return ret

i = -1
xored_code = code[0:0x39]

while True:
    i = i + 1

    xor1 = xored_code[0xa]
    xor2 = xored_code[0x11]
    xorcode = xored_code[0x2f]
    gained_c = chr(xor1^xor2)
    flag += gained_c
    if gained_c == '}':
        break
    
    xored_code = xor_block_with_int(code[(i+1)*0x39:(i+2)*0x39], xorcode)

print(flag)